Verenigde Staten
Komedie / Drama
96 minuten

geregisseerd door Ethan Coen en Joel Coen
met Brad Pitt, George Clooney en John Malkovich

Osborne Cox is een voormalige CIA-agent die na zijn ontslag begint aan zijn memoires. Zijn inhalige en overspelige vrouw ziet de digitale versie daarvan aan voor hun financiele gegevens en gaat ermee aan de haal. Wanneer die gegevens vervolgens op straat komen te liggen zien twee sportschoolmedewerkers het aan voor gevoelige CIA-informatie en proberen Osborne te chanteren. Dat leidt tot meer problemen dan ze aankunnen.

Vanaf 30 oktober in de bioscoop.

